import './kursus.css'

const Kursus = () => {
  return (
    <div className='k__kursus section__padding' id='kursus'>
        <div className='k__kursus-heading'>
            <h1 className='gradient_text'>Kursuser</h1>
        </div>
    </div>
  )
}

export default Kursus
